import React from 'react';
import { Data } from './Components/Data'; 

function App() {
    const products = Data(); 

    return (
        <div className='bg-gray-400 flex justify-around flex-wrap gap-2'>
            {Array.isArray(products) && products.map((item, index) => (
                <div key={index} className='w-[250px] h-[250px] flex gap-2 items-center justify-around flex-col bg-blue-500 m-2 p-2 rounded shadow'>
                    <span className='font-bold'>{item.title}</span>
                    <span className='text-gray-700'>${item.price.toFixed(1)}</span>
                    <span className='text-red-500'>Discounted Total: ${item.discountedTotal}</span>
                </div>
            ))}
        </div>
    );
}

export default App;
